import React, { Component } from "react";



class PersonDescription extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <tr>
                <td>{this.props.email}</td>
                <td>{this.props.firstname}</td>
                <td>{this.props.lastname}</td>
                <td>{this.props.age}</td>
            </tr>
        );
    }
}

export default PersonDescription;
